text:
QUYẾT ĐỊNH Ban hành Quy định về việc xét, cấp học bổng trao đổi sinh viên 
GIÁM ĐỐC ĐẠI HỌC BÁCH KHOA HÀ NỘI 
Căn cứ Luật Giáo dục đại học ngày 18/6/2012 và Luật sửa đổi, bổ sung một số điều của Luật Giáo dục đại học ngày 19/11/2018; 
Căn cứ Nghị định số 99/2019/NĐ-CP ngày 30/12/2019 của Chính phủ về việc Quy định chi tiết và hướng dẫn thi hành một số điều của Luật sửa đổi, bổ sung một số điều của Luật Giáo dục đại học; 
Căn cứ Quy chế Tổ chức và hoạt động của Đại học Bách khoa Hà Nội do Hội đồng đại học ban hành theo Nghị quyết số 03/NQ-ĐHBK ngày 02/02/2024;

Căn cứ Quy chế Tổ chức và hoạt động của Đại học Bách khoa Hà Nội do Hội đồng đại học ban hành theo Nghị quyết số 03/NQ-ĐHBK ngày 02/02/2024; 
Căn cứ Quy chế Quản lý tài chính của Đại học Bách khoa Hà Nội do Hội đồng đại học ban hành theo Nghị quyết số 04/NQ-ĐHBK ngày 02/02/2024; 
Căn cứ Quy chế Chi tiêu nội bộ của Đại học Bách khoa Hà Nội do Giám đốc đại học ban hành theo Quyết định số 1219/QĐ-ĐHBK ngày 02/02/2024; 
Theo đề nghị của Trưởng Ban Công tác sinh viên. 
QUYẾT ĐỊNH: 
Điều 1. Ban hành kèm theo Quyết định này Quy định về việc xét, cấp học bổng trao đổi sinh viên.

4. Mỗi sinh viên được cấp tối đa 01 lần học bổng trao đổi sinh viên trong suốt quá trình học tập tại ĐHBK Hà Nội. 
a) Sinh viên đang chịu hình thức kỷ luật từ mức khiển trách trở lên tại thời điểm xét học bổng; 
b) Sinh viên học quá thời gian theo thiết kế của chương trình đào tạo chuẩn; 
c) Sinh viên theo học chương trình đào tạo do trường đối tác nước ngoài cấp một văn bằng tốt nghiệp duy nhất; 
d) Sinh viên đã từng bị hủy bỏ và bồi hoàn học bổng theo quy định tại Điều 9 Quy định này. 
Điều 5. Mức học bổng trao đổi sinh viên và phương thức hỗ trợ 
1. Học bổng trao đổi sinh viên có giá trị tối đa là 30 triệu đồng/sinh viên.

Chương III 
TIÊU CHUẨN, HỒ SƠ VÀ QUY TRÌNH ĐĂNG KÝ XÉT, CẤP HỌC BỔNG 
Điều 6. Tiêu chuẩn được đăng ký xét cấp học bổng trao đổi sinh viên 
Sinh viên xếp hạng trình độ năm học từ năm thứ 3 trở đi, đạt đồng thời các điều kiện sau được đăng ký xét cấp học bổng trao đổi sinh viên: 
a) Có điểm học tập trung bình tích lũy đạt loại giỏi trở lên (CPA ≥ 3.2); 
b) Có trình độ ngoại ngữ đáp ứng yêu cầu của đơn vị đối tác khi đến học tập; 
c) Có điểm rèn luyện trung bình tích lũy đạt loại giỏi trở lên ( ≥ 80 điểm);

4. Nghiêm chỉnh chấp hành các quy định khác của pháp luật Việt Nam, pháp luật và phong tục tập quán của nước sở tại. 
5. Chủ động liên hệ đối tác nước ngoài để được cấp chứng nhận/ xác nhận kết quả học tập. 
6. Sau khi kết thúc chương trình học bổng, sinh viên về nước theo đúng thời gian quy định và báo cáo kết quả học tập cho Ban Công tác sinh viên trong vòng 15 ngày làm việc kể từ khi về nước. 
7. Nộp hồ sơ quyết toán học bổng cho Ban Công tác sinh viên gồm các giấy tờ sau: 
a) Bản sao chứng thực hộ chiếu (gồm cả các trang có dấu xuất, nhập cảnh); 
b) Thẻ lên máy bay chiều đi và về;

a) Bản sao chứng thực hộ chiếu (gồm cả các trang có dấu xuất, nhập cảnh); 
b) Thẻ lên máy bay chiều đi và về; 
c) Bản chứng nhận/ xác nhận kết quả học tập của đối tác nước ngoài. 
Điều 12. Trách nhiệm của các đơn vị liên quan 
1. Ban Công tác sinh viên: 
a) Là đầu mối tiếp nhận hồ sơ đăng ký xét, cấp học bổng trao đổi sinh viên; 
b) Chủ trì thẩm định hồ sơ đăng ký xét, cấp học bổng trao đổi sinh viên; 
c) Tổng hợp và trình hồ sơ đăng ký xét cấp học bổng lên Hội đồng xét, cấp học bổng Đại học;

b) Chủ trì thẩm định hồ sơ đăng ký xét, cấp học bổng trao đổi sinh viên; 
c) Tổng hợp và trình hồ sơ đăng ký xét cấp học bổng lên Hội đồng xét, cấp học bổng Đại học; 
d) Trình Giám đốc đại học phê duyệt danh sách sinh viên được đề nghị cấp học bổng và phối hợp với các đơn vị liên quan làm thủ tục cấp học bổng; 
đ) Tiếp nhận báo cáo và hồ sơ quyết toán học bổng của sinh viên; 
e) Làm thủ tục thu hồi học bổng đối với sinh viên vi phạm quy định tại Điều 9; 
g) Thực hiện thống kê, đánh giá hằng năm để báo cáo Giám đốc đại học. 
2. Ban Hợp tác đối ngoại:

e) Làm thủ tục thu hồi học bổng đối với sinh viên vi phạm quy định tại Điều 9; 
g) Thực hiện thống kê, đánh giá hằng năm để báo cáo Giám đốc đại học. 
2. Ban Hợp tác đối ngoại: 
a) Chủ trì phối hợp với các đối tác nước ngoài xây dựng các chương trình trao đổi sinh viên và cung cấp thông tin cho Ban Công tác sinh viên; 
b) Hỗ trợ sinh viên liên hệ với đối tác nước ngoài; 
c) Hỗ trợ sinh viên giải quyết các khó khăn, vướng mắc (nếu có) trong quá trình học tập tại nước ngoài; 
d) Đầu mối trao đổi, tiếp nhận các thông tin liên quan đến quá trình học tập của sinh viên;

c) Hỗ trợ sinh viên giải quyết các khó khăn, vướng mắc (nếu có) trong quá trình học tập tại nước ngoài; 
d) Đầu mối trao đổi, tiếp nhận các thông tin liên quan đến quá trình học tập của sinh viên; 
đ) Phối hợp với Ban Công tác sinh viên tổ chức các chương trình học bổng trao đổi sinh viên. 
3. Ban Đào tạo: 
a) Cung cấp kết quả học tập của sinh viên để xét học bổng; 
b) Hướng dẫn các thủ tục nghỉ học dài hạn (trong trường hợp cần thiết) và trình Giám đốc đại học ra quyết định cho sinh viên đi trao đổi; 
c) Hướng dẫn sinh viên các thủ tục nhập học trở lại sau khi về nước;

b) Hướng dẫn các thủ tục nghỉ học dài hạn (trong trường hợp cần thiết) và trình Giám đốc đại học ra quyết định cho sinh viên đi trao đổi; 
c) Hướng dẫn sinh viên các thủ tục nhập học trở lại sau khi về nước; 
d) Hướng dẫn sinh viên các thủ tục xét công nhận học phần tương đương. 
4. Ban Tài chính - Kế hoạch: 
a) Là đơn vị trực tiếp quản lý nguồn kinh phí học bổng trao đổi sinh viên; b) Chủ trì phối hợp với Ban Công tác sinh viên cấp học bổng (mua bảo hiểm, vé máy bay khứ hồi); 
c) Phối hợp với Ban Công tác sinh viên thu hồi học bổng của sinh viên vi phạm quy định tại Điều 9.

c) Phối hợp với Ban Công tác sinh viên thu hồi học bổng của sinh viên vi phạm quy định tại Điều 9. 
5. Các Trường/Viện/Khoa quản ngành (gọi chung là đơn vị quản ngành): a) Phối hợp với Ban Hợp tác đối ngoại xây dựng các chương trình trao đổi sinh viên; 
b) Cử cán bộ hỗ trợ sinh viên xây dựng kế hoạch học tập/ thực tập tại đối tác nước ngoài; hỗ trợ thông tin về chương trình học bổng do đơn vị khai thác; 
c) Phối hợp với Ban Đào tạo xét công nhận các học phần tương đương. 
Điều 13. Hội đồng xét, cấp học bổng trao đổi sinh viên
